import React from 'react'
import{BarChart,ResponsiveContainer,Bar, XAxis, YAxis, Tooltip} from 'recharts'
const array=[
  {
    name:"Male",
    HC: 13,
  },
  {
    name:"FeMale",
    HC: 10,
  },
   {
    name:"Other",
    HC: 5,
  },
]
function Category() {
  return (
    <div id='category'>
    <center><h1 id="header">Category based HC</h1></center>
   <ResponsiveContainer width="30%" aspect={1}>
      <center><BarChart id="barchart" data={array} width={350} height={300}>
      <XAxis dataKey="name"/>
      <YAxis dataKey="HC"/>
      <Tooltip/>
        <Bar  dataKey="HC" barSize={40} fill="oraplnge" data={array}/>
      </BarChart></center>
    </ResponsiveContainer>
    
    </div>
  )
}

export default Category
